import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header className="bg-blue-600 text-white py-4">
      <div className="container mx-auto flex justify-between items-center px-4">
        <Link to="/" className="text-2xl font-bold">Directory Maker</Link>
        <nav>
          <ul className="flex space-x-6">
            <li><Link to="/features" className="hover:text-blue-200">Features</Link></li>
            <li><Link to="/pricing" className="hover:text-blue-200">Pricing</Link></li>
            <li><Link to="/faq" className="hover:text-blue-200">FAQ</Link></li>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default Header;
